short decimalToSevenSegment(int n) {
    short segments[10] = {
        0b0111111, 
        0b0000110, 
        0b1011011, 
        0b1001111, 
        0b1100110, 
        0b1101101, 
        0b1111101, 
        0b0000111, 
        0b1111111, 
        0b1101111  
    };
	
    return segments[n % 10];
}

void writeNumToSevenSegment (int num){
	volatile int * segment_ptr1 = (int *)0xFF200020;
	volatile int * segment_ptr2 = (int *)0xFF200030;
	char neg = 0;
	if (num > 99999){return;}
	if (num < 0){ num *= -1; neg = 1;}
	int first = 0;
	int second =  0;
	int digits[6] = {0};
	int curDigit = 0;
	while (num != 0){
		digits[curDigit] = num % 10;
		num = num / 10;
		curDigit += 1;
	}
	first = 0 + decimalToSevenSegment(digits[0])  
	 + (decimalToSevenSegment(digits[1])  << 8)
	 + (decimalToSevenSegment(digits[2]) << 16) + (decimalToSevenSegment(digits[3]) << 24);
	 
	if (neg == 0){
		second  = 0  + (decimalToSevenSegment(digits[4])) + (decimalToSevenSegment(digits[5]) << 8);
	} else {
		second = 0  + (decimalToSevenSegment(digits[4])) + (0b1000000 << 8);
	}
	*(segment_ptr1) = first;
	*(segment_ptr2) = second;
}

short calculateSquareCost(Player p, Square s, Property* propertys){
	if (s.val != 0){return s.val;}
	if (s.num == 29){return -400 + rand()%700;};
	if (s.propertyNum == 22){return 0;}
	Property prop = propertys[s.propertyNum];
	if (prop.owner == 4){
		return 0;
	}
	if (prop.owner == p.num){
		return 0;
	}
	if (prop.owner != p.num){
		if (prop.status == 0){return -1 *prop.rent1;}
		if (prop.status ==1){return -1 *prop.rent2;}
		if (prop.status ==2){return -1 *prop.rent3;}
	}
	return 0;
}
void play_audio_roll(){
	
	volatile int *audio_ptr = (int *)0xFF203040;
    int fifospace;
    int index = 0;

    while (1) {
        fifospace = *(audio_ptr + 1); 
		
        /*Extract the available space for left and right audio-out FIFOs
		  Extract WSRC (available space in left audio-out FIFO)
		  Extract WSLC (available space in right audio-out FIFO)*/
        int space_left = (fifospace >> 24) & 0xff; 
        int space_right = (fifospace >> 16) & 0xff; 

        // enough space in both FIFOs 
        if (space_left > 64 && space_right > 64) { 
            *(audio_ptr + 2) = dicesound[index]; // Write to left 
            *(audio_ptr + 3) = dicesound[index]; // Write to right 
            index++;

            if (index >= 11136) { 
                index = 0;
				
				break; // Reset index
            }
        }
    }
	int space_left = (fifospace >> 24) & 0xff; 
    int space_right = (fifospace >> 16) & 0xff; 

		
}


