void write_char(int x, int y, char c) {
  
  volatile char * character_buffer = (char *) (0x09000000 + (y<<7) + x);
  *character_buffer = c;
}
void clear_char(){
    short max_x = 79;
    short max_y = 59;

    for (short x = 0; x<max_x; x++){
        for (short y = 0; y<max_y; y++){
            write_char(x,y, 0);
        }
    }
}

int read_number_from_keyboard(){
	    int number = 0;
		breakCode = 0;
	    while (1) {
		fill_bgm();
        PS_2_data = *(PS_2_ptr);  
        RVALID = (PS_2_data & 0x8000);  
        if (RVALID) {
            scan_code = PS_2_data & 0xFF;

			if (scan_code == 0XF0){
				breakCode = 1;
				continue;
			}
			if (breakCode) {
                breakCode = 0;  
                continue;
            }
            if (scan_code == 0x5A) {

                break;
            }

            if (scan_code >= 0x16 && scan_code <= 0x46) {
               
                int digits = keyMapping[scan_code];
                number = number * 10 + digits;
				
            }
        }

    }
	return number;

}

