void drawProperties(Property* propertys, Square * squares, Player* players){
	
	
	for (int i =0; i< 22; i++){
		short startx = squares[propertys[i].sqaureNum].drawx;
		short starty = squares[propertys[i].sqaureNum].drawy;
		char dirx = 0;
		char diry = 0;
		if (propertys[i].color == 0 || propertys[i].color == 1){
			starty -= 8;
			dirx = 1;
		}
		if (propertys[i].color == 2 || propertys[i].color == 3){
			startx += 27;
			diry = 1;
		}
		if (propertys[i].color == 4 || propertys[i].color == 5){
			starty += 30;
			dirx = 1;
		}
		if (propertys[i].color == 6 || propertys[i].color == 7){
			startx -= 10;
			diry = 1;
		}

		short color = (propertys[i].owner == 4) ? 0 : players[propertys[i].owner].color;
		for (int j = 0; j < propertys[i].status+1; j++){
			draw_rect(startx+dirx*j*7,starty+diry*j*7,startx+dirx*j*7 + 4, starty+diry*j*7 + 4, color);
		}
	}
	
}